import React from "react";
// import { connect } from "react-redux";
import { Link } from "react-router-dom";
import Particles from "react-particles-js";
//https://www.npmjs.com/package/react-particles-js
const particleOpt = {
  //   polygon: {
  //     enable: true,
  //     type: "inside",
  //     move: {
  //       radius: 10
  //     },
  //     url: "path/to/svg.svg"
  //   }
  //   particles: {
  //     number: {
  //       value: 150,
  //       density: {
  //         enable: true,
  //         value_area: 800
  //       }
  //     }
  //   }
};

function ParticleTesting() {
  return (
    <div className="bg-blue-900 h-auto">
      {/* <Particles params={particleOpt}>
      </Particles> */}
      <Particles
        params={{
          fps_limit: 28,
          particles: {
            number: {
              value: 200,
              density: {
                enable: false
              }
            },
            line_linked: {
              enable: true,
              distance: 30,
              opacity: 0.4
            },
            move: {
              speed: 1
            },
            opacity: {
              anim: {
                enable: true,
                opacity_min: 0.05,
                speed: 2,
                sync: false
              },
              value: 0.4
            }
          },
          polygon: {
            enable: true,
            scale: 0.5,
            type: "inline",
            move: {
              radius: 10
            },
            url: "/small-deer.2a0425af.svg",
            inline: {
              arrangement: "equidistant"
            },
            draw: {
              enable: true,
              stroke: {
                color: "rgba(255, 255, 255, .2)"
              }
            }
          },
          retina_detect: false,
          interactivity: {
            events: {
              onhover: {
                enable: true,
                mode: "bubble"
              }
            },
            modes: {
              bubble: {
                size: 6,
                distance: 40
              }
            }
          }
        }}
      />
    </div>
  );
}
export default ParticleTesting;
